import React, { useState } from "react";

export const Closed_Toggler_Button = () => {

    const [OnOff, updateOnnOff] = useState('on')
    const [Toggle, updateToggle] = useState('')
    
    

    switch(OnOff){

    case('on'): 
        
        return <React.Fragment>
        <span id='Closed_Toggler_Button' onClick={updateToggle('on')}>
            Open Filter
        </span>
        </React.Fragment>
    
    case('off'):

        return <React.Fragment>
        <span id='Closed_Toggler_Button' onClick={updateToggle('off')}>
            Close Filter
        </span>
        </React.Fragment>

    }
}

export default Closed_Toggler_Button;
